					</div>
					<p> {project.blurb} </p>
					{/*<ul>
						<li>
							<a href={project.live}> live app </a>
						 </li>
						<li>
						 	<a href={project.repo}> repo </a>
						 </li>
					</ul>*/}
				</section>
				);
		})

	render(){
		return(
			<div className ="Projects">
					{this.renderProjects}
			</div>
		)
	}
}
